    class Profession extends Component {
        render() { 
  return (
  
  
    <div class="card bg-dark text-white">
  <img src="./img1.jpg" class="card-img" alt="..."/>
  
  <div >

    <h5 ><b>Profession</b></h5>
    <div style={{background:"green"}}>
    <p> I am currently a student at GO My Code Academy, a new opportunity as a software Developper Full stack
    ....
Motivated, curious, ambitious, always looking to improve my skills.</p>
    <p ><b>SKIILS</b> <br/> -HTML/CSS <br/> -JAVASCRIPT <br/> -REACT <br/> -Visual Studio <br/></p>
    </div>
  </div>
</div>
    
  );
}}
